        display: block;
        content: '';
        position: absolute;
        bottom: -.125rem;
        left: 0;
        right: 0;
        height: .125rem;
        background: white;
      }
      &.active{
        color: #333333;
        &:after{
         background: #F19B40;
        }
      }
    }
  }
}

