}*/
/*动画 fade,bounce*/
.fade-enter-active, .fade-leave-active {
    transition: opacity .2s;
  }
.fade-enter-active, .fade-leave-active {
    opacity: 0;
}

  .bounce-enter-active {
  animation: bounce-in .5s;
}
.bounce-leave-active {
  animation: bounce-out .5s;
}
@keyframes bounce-in {
  0% {
    transform: scale(0);
  }
  50% {
    transform: scale(1.5);
  }
  100% {
    transform: scale(1);
  }
}
@keyframes bounce-out {
  0% {
    transform: scale(1);
  }
  50% {
    transform: scale(1.5);
  }
  100% {
    transform: scale(0);
  }
}
#app{
  height: 100%;
  width: 100%;
  display: flex;
  flex-direction: column;
}
.van-slider__bar{
  background-color: #F19B40;
}
.van-slider__button{
  box-shadow: none;
  border:2px solid #F19B40;
}
.inline{
  display: inline-block;
}
.text__center{
  text-align: center;
}
.van-popup{
  background-color: transparent;
  color: white;
}
