.home-list{
  padding-top: .5rem;
  height: calc(100% - 8rem);
  .list-head{
    padding-left: 1rem;
    padding-right: 1rem;
    display: flex;
    li{
      float: left;
      width: calc(100%/4);
      color: #B6B6B6;
      font-size: .5rem;
      text-align: center;
      &.first{
        width: 7rem;
        position: relative;
        &::before{
          position: absolute;
          content: '';
          width: 1rem;
          height: 1rem;
          left:0;
          background-image: url('./../../asset/ic_choose@2x.png');
          background-size: 100% 100%;
        }
      }
      &.last{
        width: 4.5rem;
        align-items: flex-end;
      }
      &.flex{
        flex: 1;
        position: relative;
        &::before{
          position: absolute;
          content: '';
          width: 0;
          height: 0;
          top: .2rem;
          right: .8rem;
          color: #B6B6B6;
          border-left:.25rem solid transparent;
          border-top:.25rem solid transparent;
          border-bottom:.25rem solid #B6B6B6;
          border-right:.25rem solid transparent;     
        }
        &::after{
          position: absolute;
          content: '';
          width: 0;
          height: 0;
          right: .8rem;
          bottom: 0;
          top: .8rem;
          color: #B6B6B6;
          border-left:.25rem solid transparent;
          border-top:.25rem solid #B6B6B6;
          border-bottom:.25rem solid transparent;
          border-right:.25rem solid transparent; 
        }
      }
      &.desc{
        &::before{
          border-bottom:.25rem solid #333333;
        }

      }
      &.asc{
        &::after{
          border-top:.25rem solid #333333;
        }
      }
    }
    height:1.5rem;
    line-height:1.5rem;
    border-bottom: 1px solid #DEDBDC;
  }
  .van-pull-refresh{
    height: calc(100% - 1.5rem);
    overflow: auto;
  }
  .list-row{
    .row-default{
      display: flex;
      padding-left: 1rem;
      padding-right: 1rem;
    }
    .list-cell{
      &.first{
        text-align: left;
        width: 7rem;
      }
      &.last{
        width: 4.5rem;
        align-items: flex-end;
      }
      &.flex{
        flex: 1;
      }
      height: 4rem;
      text-align: center;
      display: flex;
      flex-direction: column;
      justify-content: center;
    }
    .row-slider__content{
      display: flex;
      .slider-bar{
        flex: 1;
      }
      span{
        font-size: 1rem;
        color: #666666;
        margin-left: 1.5rem;
        padding-top: 5px;
      }
    }
  }
  .fastwarning{
    width: 4.5rem;
    height: 2rem;
    border: 1px solid #F19B40;
    border-radius: 0.38rem;
    background-color: white;
    color: #F19B40;
    line-height: 2rem;
    text-align: center;
    font-size: .5rem;
  }
  .fastsetting{
    width: 4.5rem;
    height: 2rem;
    border: 1px solid #EA9944;
    border-radius: 0.38rem;
    background-color: #F4B551;
    color: #FFFFFF;
    line-height: 2rem;
    text-align: center;
    font-size: .5rem;
  }
  .modify{
    width: 4.5rem;
    height: 2rem;
    border: 1px solid #EA9944;
    border-radius: 0.38rem;
    background-color: #F4B551;
    color: #FFFFFF;
    line-height: 2rem;
    text-align: center;
    font-size: .5rem;
  }
  .row-set{
    height: 15.5rem;
    background-color: #FAFAFA;
    padding-top:1rem;
    padding-left:1.5rem;
    padding-right:1.5rem;
    h2{
      font-family:Regular;
    }
    .set-top{

    }
    .van-slider{
      margin-top: 1rem;
      margin-bottom: 1.5rem;
    }
    .set-jump{
      font-size: .5rem;
      color: #9A9A9A;
      float: right;
    }
  }
  .sortlist{
    padding-left:1rem;
    padding-right:1rem;
    p{
      background: #F7F7F7;
      height:3rem;
      line-height:3rem;
      button{
        width: 4rem;
        height: 1.37rem;
        line-height: 1.37rem;
        border-radius: 0.67rem;
        border: 0.08rem solid #979797;
        color: #B6B6B6;
        &.active{
          color: #FFFFFF;
          background-color: #F4B551;
          border-color: #EA9944;
        }
      }
    }
  }
}

